import './Skills.css'
import icon_react from '../../utils/img/react-icon.svg'

function Skills() {
    return (
        <div>
            <p>HABILIDADES</p>

            <section className="container-skills">
                <article className='s'>
                    <img src={icon_react}/>
                    <p className='skill-name'>React</p>
                </article>

            </section>
        </div>
        
    );
}

export default Skills;
